//구몬 나무시리즈 공용 라이브러리
window.kmnm =
    (() => {
        var isStarted = false;

        //앱 실행 환경인지 체크
        function isRunningApp() {
            /**
             * iOS 대응 수정
             * @author 유승빈
             * @since 2023.12.15
             */
            const isAOS = window.kumonmbr ? true : false;
            const isIOS = window.webkit && window.webkit.messageHandlers && window.webkit.messageHandlers.kumonmbr ? true : false;
            return isAOS || isIOS;
        }

        //연동 API
        const api = {};

        //콘텐츠 시작(수업 시작)
        api.startContents = () => {
            isStarted = true;
            console.error('===== Call [startContents] API =====');
        };

        api.replay = () => {
            console.error('===== Call [replay] API =====');
        };

        //콘텐츠 종료(수업 완료)
        api.finishContents = () => {
            console.error('===== Call [finishContents] API =====');
        };

        //콘텐츠 나가기
        api.exit = () => {
            isStarted = false;
            console.error('===== Call [exit] API =====');
        };

        api.isStarted = () => {
            return isStarted;
        };

        api.startVideo = () => {
            console.error('===== Call [startVideo] API =====');
        };

        api.endVideo = () => {
            console.error('===== Call [endVideo] API =====');
        };

        //앱 기능 API
        const app = {
            audio: {},
            camera: {},
        };

        //음성 녹음 시작
        app.audio.startRecord = (/*Function*/ cbFunc, /*Number*/ time) => {
            console.error('===== Call [audio.startRecord] API =====');

            if (!time) time = 5;

            if (cbFunc) {
                cbFunc(true);
            }
        };

        //음성 녹음 종료(인터페이스 변경으로 삭제)
        app.audio.stopRecord = (/*Function*/ cbFunc) => {
            console.error('===== Call [stopRecord] API =====');

            if (cbFunc) {
                const sampleAudio =
                    'data:audio/mpeg;base64,';
                cbFunc(sampleAudio);
            }
        };

        //음성 녹음 취소
        app.audio.cancelRecord = (/*Function*/ cbFunc) => {
            console.error('===== Call [cancelRecord] API =====');

            if (cbFunc) {
                cbFunc(true);
            }
        };

        //녹음된 음원 재생 시작
        app.audio.playRecordedAudio = (/*Function*/ cbFunc) => {
            console.error('===== Call [playRecordedAudio] API =====');

            if (cbFunc) {
                //TODO 실제 재생은 하지 않으나 나중에 필요하다면 추가
                //const sampleAudio = 'data:audio/wav;base64,';
                //const sampleAudio = 'data:audio/mpeg;base64,';
                cbFunc(true);
            }
        };

        //녹음된 음원 재생 중지
        app.audio.stopRecordedAudio = (/*Function*/ cbFunc) => {
            console.error('===== Call [stopRecordedAudio] API =====');

            if (cbFunc) {
                cbFunc(true);
            }
        };

        //카메라 보이기
        app.camera.show = (/*Object{x,y,w,h}*/ coord, /*Function*/ cbFunc) => {
            if (coord) {
                if (!isNaN(coord.x) && !isNaN(coord.y) && !isNaN(coord.w) && !isNaN(coord.h)) {
                    console.error('===== Call [camera.show] API =====');
                    document.getElementById("test").innerHTML =  "<span style='color: black;text-align:center; size: 30;'>" +  "call camera API" + "</span>"; 

                    //TODO 테스트
                    if (cbFunc) {
                        cbFunc(true);
                    }

                    console.log("call webcam");
                    document.getElementById("test").innerHTML =  "<span style='color: black;text-align:center; size: 30;'>" +  "call camera show" + "</span>"; 

                    CallFunction();
                }
            }
        };

        //카메라 숨기기
        app.camera.hide = (/*Function*/ cbFunc) => {
            console.error('===== Call [camera.hide] API =====');
            //TODO 테스트
            if (cbFunc) {
                cbFunc(true);
            }
        };

        //앱 실행 환경에서는 모든 API를 Override 한다.
        if (isRunningApp()) {
            let onRecordedAudioCanPlay;
            let isRecording = false;

            //콘텐츠 시작(수업 시작)
            api.startContents = () => {
                isStarted = true;
                try {
                    console.error('Code', kmnm.contentsCode);
                    /**
                     * iOS 대응 수정
                     * @author 유승빈
                     * @since 2023.12.14
                     */
                    toKumonApp.wnPageEnabled(kmnm.contentsCode);
                } catch (e) {
                    console.error(e);
                }
            };

            api.replay = () => {
                try {
                    /**
                     * iOS 대응 수정
                     * @author 유승빈
                     * @since 2023.12.14
                     */
                    toKumonApp.wnReplay('');
                } catch (e) {
                    console.error(e);
                }
            };

            //콘텐츠 종료(수업 완료)
            api.finishContents = (/*Object {wrongCnt:1}*/ param) => {
                if (!param || param.wrongCnt === undefined) {
                    param = { wrongCnt: 0 };
                }

                try {
                    /**
                     * iOS 대응 수정
                     * @author 유승빈
                     * @since 2023.12.14
                     */
                    toKumonApp.wnContentFinish(JSON.stringify(param));
                } catch (e) {
                    console.error(e);
                }
            };

            //콘텐츠 나가기
            api.exit = () => {
                try {
                    Array.from(document.querySelectorAll('video')).forEach((video) => {
                        const child = video.childNodes;

                        if (child && child.length) {
                            child.forEach((e) => {
                                if (e.src) {
                                    delete e.src;
                                }

                                if (e.remove) {
                                    e.remove();
                                }
                            });
                        }

                        delete video.src;
                        video.remove();
                    });

                    /**
                     * iOS 대응 수정
                     * @author 유승빈
                     * @since 2023.12.14
                     */
                    toKumonApp.wnContentExit();
                } catch (e) {
                    console.error(e);
                }
            };

            api.startVideo = () => {
                try {
                    /**
                     * iOS 대응 수정
                     * @author 유승빈
                     * @since 2023.12.14
                     */
                    toKumonApp.wnStartVideo('');
                } catch (e) {}
            };

            api.endVideo = () => {
                try {
                    /**
                     * iOS 대응 수정
                     * @author 유승빈
                     * @since 2023.12.14
                     */
                    toKumonApp.wnEndVideo('');
                } catch (e) {}
            };

            //음성 녹음 시작
            app.audio.startRecord = (/*Function*/ cbFunc, /*Number*/ time) => {
                //녹음 경로 초기화
                kmnm.recordPath = undefined;
                window.nwRecordComplete = undefined;
                isRecording = false;
                onRecordedAudioCanPlay = undefined;

                if (!time) time = 5;

                try {
                    /**
                     * iOS 대응 수정
                     * @author 유승빈
                     * @since 2023.12.14
                     */
                    toKumonApp.wnRecordVoice(String(time), 'kmnm.appApiCallback("StartRecord")');
                    isRecording = true;

                    //녹음 완료 Callback
                    window.nwRecordComplete = function (/*String*/ path) {
                        window.kmnm.recordPath = path;
                        onRecordedAudioCanPlay && onRecordedAudioCanPlay(path);
                        onRecordedAudioCanPlay = undefined;
                    };

                    if (cbFunc) cbFunc(true);
                } catch (e) {
                    console.error(e);
                    if (cbFunc) cbFunc(false);
                }
            };

            //음성 녹음 취소
            app.audio.cancelRecord = (/*Function*/ cbFunc) => {
                //녹음 경로 초기화
                kmnm.recordPath = undefined;

                try {
                    if (cbFunc) kmnm.cbFunc = cbFunc;

                    /**
                     * iOS 대응 수정
                     * @author 유승빈
                     * @since 2023.12.14
                     */
                    toKumonApp.wnRecordVoiceCancel('kmnm.appApiCallback("CancelRecord")');
                } catch (e) {
                    console.error(e);
                    if (cbFunc) cbFunc(false);
                }
            };

            //녹음된 음원 재생 시작
            app.audio.playRecordedAudio = (/*Function*/ cbFunc) => {
                if (kmnm.recordPath) {
                    try {
                        if (cbFunc) kmnm.cbFunc = cbFunc;

                        /**
                         * iOS 대응 수정
                         * @author 유승빈
                         * @since 2023.12.14
                         */
                        toKumonApp.wnPlaySound(kmnm.recordPath, 'kmnm.appApiCallback("StartPlay")');
                        isRecording = false;
                    } catch (e) {
                        console.error(e);
                        if (cbFunc) cbFunc(false);
                    }
                } else {
                    if (isRecording) {
                        onRecordedAudioCanPlay = (path) => {
                            app.audio.playRecordedAudio(cbFunc);
                        };
                    } else {
                        if (cbFunc) cbFunc(false);
                    }
                }
            };

            //녹음된 음원 재생 중지
            app.audio.stopRecordedAudio = (/*Function*/ cbFunc) => {
                if (kmnm.recordPath) {
                    try {
                        if (cbFunc) kmnm.cbFunc = cbFunc;

                        /**
                         * iOS 대응 수정
                         * @author 유승빈
                         * @since 2023.12.14
                         */
                        toKumonApp.wnStopPlaySound(kmnm.recordPath, 'kmnm.appApiCallback("StopPlay")');
                    } catch (e) {
                        console.error(e);
                        if (cbFunc) cbFunc(false);
                    }
                } else {
                    if (cbFunc) cbFunc(false);
                }
            };

            //카메라 보이기
            app.camera.show = (/*Object{x,y,w,h}*/ coord, /*Function*/ cbFunc) => {
                if (coord) {
                    if (!isNaN(coord.x) && !isNaN(coord.y) && !isNaN(coord.w) && !isNaN(coord.h)) {
                        try {
                            /**
                             * iOS 대응 수정
                             * @author 유승빈
                             * @since 2023.12.14
                             */
                            toKumonApp.wnCameraViewStart(String(coord.x), String(coord.y), String(coord.w), String(coord.h));
                            if (cbFunc) cbFunc(true);
                        } catch (e) {
                            console.error(e);
                            if (cbFunc) cbFunc(false);
                        }
                    }
                }
            };

            //카메라 숨기기
            app.camera.hide = (/*Function*/ cbFunc) => {
                try {
                    /**
                     * iOS 대응 수정
                     * @author 유승빈
                     * @since 2023.12.14
                     */
                    toKumonApp.wnCameraViewClose();
                    if (cbFunc) cbFunc(true);
                } catch (e) {
                    console.error(e);
                    if (cbFunc) cbFunc(false);
                }
            };
        }
        /*********************** 이상 API Override 끝  ***********************/

        //App API Callback(공통)
        function appApiCallback(/*String*/ type) {
            if (type === 'CancelRecord' || type === 'StartPlay' || type === 'StopPlay') {
                if (kmnm.cbFunc) {
                    kmnm.cbFunc(true);

                    delete kmnm.cbFunc;
                }
            }
        }

        //공용 유틸
        const util = {};

        let audioTag, audioSrc;

        //콘텐츠 Pause / Resume
        util.pauseResumeContents = (
            /*Boolean*/ isResume,
            { media = true, timer = true } = {
                media: true,
                timer: true,
            }
        ) => {
            //Media류 위젯 Pause / Resume
            if (media) {
                if (window.apnExe) {
                    const pm = window.apnExe.getPM();

                    if (pm) {
                        pm.iteratePage((page) => {
                            if (page && page.canvas) {
                                page.canvas.exeOnPageState('exeOnScreenVisibility', page.id, isResume ? 'visible' : 'hidden');
                            }
                        });
                    }
                }
            }

            if (timer) {
                //Aspen Timer Pause / Resume
                if (isResume) {
                    bx.Transition.resumeTimer();
                } else {
                    bx.Transition.pauseTimer();
                }
            }
        };

        //앱 실행 환경인지 체크
        util.isRunApp = isRunningApp;

        util.popupAudioInit = (/*Boolean*/ preview, /*String*/ url, callback) => {
            audioTag = document.createElement('audio');
            audioTag.innerHTML = '<source>';
            var fileName = preview ? url : url.split('RA')[1].replace('_', '.');
            var path = preview ? 'http://blg.aspenux.com/aspen/asset/A/' : './asset/A/';
            audioTag.querySelector('source').src = path + fileName;
            audioSrc = path + fileName;
            audioTag.load();

            // console.log(audioTag);
            // audioTag.onload = callback;
            // audioTag.addEventListener("load", function(e) {
            //     console.log("test");
            // });
            // audioTag.addEventListener("load", function(e) {
            //     callback && callback();
            // });
        };

        util.popupAudioPlay = () => {
            audioTag && audioTag.play();
        };

        util.popupAudioStop = () => {
            audioTag.pause();
            audioTag.currentTime = 0;
        };

        return {
            api: api,
            app: app,
            util: util,
            appApiCallback: appApiCallback,
        };
    })() || {};

