apx.addEventListener('preboot', async function (fnBoot, dataCtxt) {
    //파일명으로 부터 콘텐츠 코드를 구한다.
    const arrTitle = dataCtxt.project.property.title.split('_');

    if (arrTitle && arrTitle.length >= 3) {
        arrTitle.shift();
        arrTitle.shift();

        window.kmnm.contentsCode = arrTitle.join('_');
    } else {
        window.kmnm.contentsCode = '';
    }

    // asset pre loading
    if (false && !apx.isPreview()) {
        try {
            const assetJson = await fetch('./asset/asset.json').then((response) => response.json());

            await new Promise(async (resolve) => {
                Promise.allSettled(
                    assetJson.asset.map(
                        ({ assetId, assetType, originFileName }) =>
                            new Promise((resolve, reject) => {
                                const path = `./asset/${assetType}/${assetId}.${originFileName.split('.').pop()}`;
                                switch (assetType) {
                                    case 'I':
                                        const image = new Image();
                                        image.src = path;
                                        image.onload = (_) => resolve(image);
                                        image.onerror = reject;
                                        break;
                                    case 'A':
                                        const audio = new Audio(path);
                                        audio.oncanplaythrough = (_) => resolve(audio);
                                        audio.onerror = reject;
                                        break;
                                    case 'V':
                                        const video = document.createElement('video');
                                        video.src = path;
                                        video.onloadeddata = (_) => resolve(video);
                                        video.onerror = reject;
                                        break;
                                }
                            })
                    )
                ).then((results) => {
                    results.forEach(({ value }) => {
                        if (value?.remove) {
                            value.remove();
                        }
                    });

                    resolve();
                });

                setTimeout(resolve, 10 * 1000);
            });
        } catch (e) {
            console.error(e);
        }

        console.error('wnPageLoadFinish', '1');
        /**
         * iOS 대응 수정
         * @author 유승빈
         * @since 2023.12.15
         */
        window.toKumonApp?.wnPageLoadFinish && window.toKumonApp?.wnPageLoadFinish('1');
    }

    console.error('wnPageLoadFinish', '1');
    /**
     * iOS 대응 수정
     * @author 유승빈
     * @since 2023.12.15
     */
    window.toKumonApp?.wnPageLoadFinish && window.toKumonApp?.wnPageLoadFinish('1');

    fnBoot();
});

