apx.addEventListener(
    'pageBubble',
    (Event, ctx) => {
        with (ctx) {
            if (!Event.target) {
                if (Event.type == 'Page Create') {
                    //속도를 위해 시작 버튼 이미지를 소스에 삽입함
                    $W('playimg').set(
                        'media',
                        'data:image/png;base64,'
                    );

                    File.get('$ctxs', []);
                    Array.from(document.querySelectorAll('audio') || []).forEach((audio) => {
                        audio.muted = false;
                    });
                    Array.from(document.querySelectorAll('video') || []).forEach((video) => {
                        video.muted = false;
                    });

                    if (File.get('$reset')) {
                        onPageCreate();
                    } else {
                        $W('r$dim').set('visibility', 'hidden');
                        $W('r$play').set('visibility', 'visible');
                        $W('r$play').zIndexTo('Top');
                        $W('r$play').moveTo(0, 0);
                    }
                } else if (Event.type == 'Custom Event') {
                    var param = Event.param;
                    if (param.indexOf('|') > -1) {
                        if (param.split('|')[0] == 'Overlay') {
                            var type = param.split('|')[1];
                            if (type == 'InitIndicator') {
                                initIndicator();
                            } else if (type == 'ShowIndicator') {
                                visibleIndicator('visible');
                            } else if (type == 'HideIndicator') {
                                visibleIndicator('hidden');
                            } else if (type == 'SetIndicator') {
                                setIndicator();
                            } else if (type == 'MoveIndicator') {
                                moveIndicator();
                            } else if (type == 'ShowEnding') {
                                // showEndApi();
                                ending();
                            } else if (type == 'FadeInBgm') {
                                bgmFadeIn();
                            } else if (type == 'FadeOutBgm') {
                                bgmFadeOut();
                            } else if (type == 'PlayBgm') {
                                $W('a$bgm').changeState('Play');
                            } else if (type == 'StopBgm') {
                                $W('a$bgm').changeState('Stop');
                            } else if (type == 'PauseBgm') {
                                $W('a$bgm').changeState('Pause');
                            } else if (type == 'ResumeBgm') {
                                $W('a$bgm').changeState('Resume');
                            } else if (type == 'ShowBackButton') {
                                $W('b$back').set('visibility', 'visible');
                            } else if (type == 'HideBackButton') {
                                $W('b$back').set('visibility', 'hidden');
                            } else if (type == 'ReadyUI') {
                                $W('r$dim').set('visibility', 'hidden');
                            }
                        }
                    }
                    if (param === 'ON_START') {
                        $W('r$dim').set('visibility', 'hidden');
                    }
                }
            } else {
                var label = Event.target.get('label');
                if (Event.type == 'Tap Start') {
                    if (label == 'playimg') {
                        Event.target.set('visibility', 'visibleEventPass');
                        //일부러 기다림
                        setTimeout((_) => {
                            $W('r$play').set('visibility', 'hidden');
                            onPageCreate();
                        }, 1000);
                    } else if (label == 'b$finish') {
                        $W('a$click').changeState('Play');
                        ending();
                    } else if (label == 'b$back') {
                        onTapBack();
                    } else if (label == 'b$back_y') {
                        onTapBackYes();
                    } else if (label == 'b$back_n') {
                        onTapBackNo();
                    } else if (label.indexOf('sia$finish') > -1) {
                        onTapFinish();
                    } else if (label.indexOf('sia$replay') > -1) {
                        onTapReplay();
                    } else if (label == 'test') {
                        fireEvent('Custom', 'Overlay|ShowEnding');
                    }
                } else if (Event.type == 'Media') {
                    if (label.indexOf('a$finish_') > -1) {
                        if (Event.param == 'End') {
                            var goodAudio = $W('a$good_' + label.split('_')[1]);
                            goodAudio.set('media', get('$template:option')[0][4]);
                            goodAudio.changeState('Play');
                        }
                    }
                }
            }
            function clickEffect(btn, callback, originTop, audio) {
                originTop &&
                    btn.set('origin', {
                        x: 0.5,
                        y: 0,
                    });

                !audio && $W('a$click').tag.childNodes[0].play();

                btn.zoomTo(100, 100, {
                    onEnd: function () {
                        btn.zoomTo(95, 95, {
                            timing: 'linear 500ms roundTrip',
                            onEnd: function () {
                                callback && callback();
                            },
                        });
                    },
                });
            }
            // Page Create
            function onPageCreate() {
                // $W("r$dim").set("visibility", "visible");
                kmnm.api.startContents();
                var bgm = $W('a$bgm');
                var volume = get('$template:option')[0][1];
                set('$bgm:volume', volume);
                bgm.set('media', get('$template:option')[0][0]);
                bgm.setData('volume', volume);
                $W('i$ribbon').set('media', get('$template:option')[0][2]);
                set('$indicator:style', get('$template:option')[0][6]);
                kmnm.util.popupAudioInit(Event.preview, $W('a$popup').get('media'));
                // setTimeout(function(){
                //     fireEvent("Custom", "Overlay|ContentStart");
                // }, 10);

                if (File.get('$isCreate')) {
                    fireEvent('Custom', 'Overlay|ContentStart');
                    File.set('$isCreate', false);
                } else {
                    File.set('$callStart', true);
                }
                File.set('$option:guide', get('$template:option')[0][7]);
            }

            function contentEnd() {
                File.set('$callStart', false);
                File.set('$isCreate', false);
                if (kmnm.util.isRunApp()) {
                    (File.get('$ctxs') || []).forEach((ctx) => {
                        ctx.reset = function () {};
                    });
                    try {
                        var clickAudio = $W('a$click').tag.childNodes[0];
                        Array.from(document.querySelectorAll('audio') || []).forEach((audio) => {
                            if (clickAudio === audio) {
                                return;
                            }
                            audio.muted = true;
                        });
                        Array.from(document.querySelectorAll('video') || []).forEach((video) => {
                            video.muted = true;
                        });
                    } catch (e) {}
                    kmnm.util.pauseResumeContents(false);
                } else {
                    kmnm.util.pauseResumeContents(true);
                }
            }

            // 완료 버튼 클릭
            function onTapFinish() {
                // contentEnd();
                clickEffect(Event.target, function () {
                    showEndApi();
                    kmnm.api.exit();
                    // kmnm.api.finishContents();
                    File.set('$reset', false);
                    contentEnd();
                    reset();
                    fireEvent('Custom', 'Overlay|ContentEnd', true);
                });
            }

            // 다시하기 버튼 클릭
            function onTapReplay() {
                kmnm.api.replay();
                clickEffect(Event.target, function () {
                    File.set('$reset', true);
                    reset();
                    fireEvent('Custom', 'Overlay|ContentReset', true);
                });
            }

            kmnm.api.back = function () {
                if (!kmnm.api.isStarted()) {
                    return;
                }

                showPopup($W('mlc$back'));
                kmnm.util.pauseResumeContents(false);
                kmnm.util.popupAudioPlay();
            };

            // 뒤로가기 버튼 클릭
            function onTapBack() {
                var target = Event.target;
                fireEvent('Custom', 'Overlay|TapBack');
                kmnm.util.pauseResumeContents(false, {
                    timer: false,
                });
                clickEffect(
                    target,
                    function () {
                        fireEvent('Custom', 'Overlay|TapBackEnd');
                        kmnm.api.back();
                    },
                    true
                );
                // clickEffect(Event.target, function() {
                //     fireEvent('Custom', "Overlay|TapBackCallback");
                // });
                target.set('visibility', 'visibleEventPass');
            }

            // back 팝업 예 버튼 클릭
            function onTapBackYes() {
                // contentEnd();
                kmnm.util.popupAudioStop();
                kmnm.util.pauseResumeContents(true, {
                    media: false,
                });
                $W('mlc$back').set('visibility', 'visibleEventPass');
                $W('a$', undefined, { multiple: true, like: true }).forEach(function (audio) {
                    if (audio.get('label').split('$')[0] == 'a') {
                        if (audio.get('label') == 'a$click') {
                            audio.changeState('Play');
                        } else {
                            audio.setData('muted', true);
                            audio.changeState('Stop');
                        }
                    }
                });

                clickEffect(Event.target, function () {
                    showEndApi();

                    // kmnm.util.pauseResumeContents(true);
                    kmnm.api.exit();
                    File.set('$reset', false);
                    contentEnd();
                    reset();
                    fireEvent('Custom', 'Overlay|ContentEnd', true);
                });
            }

            // back 팝업 아니오 버튼 클릭
            function onTapBackNo() {
                kmnm.util.popupAudioStop();
                kmnm.util.pauseResumeContents(true, {
                    media: false,
                });
                fireEvent('Custom', 'Overlay|TapBackNo');
                clickEffect(Event.target, function () {
                    kmnm.util.pauseResumeContents(true);
                    $W('mlc$back').moveTo(1280, 0);
                    $W('mlc$back').set('visibility', 'hidden');
                    $W('b$back', undefined, { multiple: true, like: true }).forEach(function (button) {
                        button.set('visibility', 'visible');
                    });
                    fireEvent('Custom', 'Overlay|TapBackNoCallback');
                    // fireEvent("Custom", "Overlay|TapBackNo");
                });
            }

            // 인디케이터 초기 값 지정
            function initIndicator() {
                // $W("mlc$indicator_1").set("visibility", "visibleEventPass");
                if (get('$indicator:style').indexOf('star') !== -1) {
                    var indicatorLength = Event.param.split('|')[2];
                    set('$indicatorLength', indicatorLength);
                    var copyIndicatorBack = $W('mlc$indicator_1');
                    var padding;
                    var indicators = [];
                    var indicatorCount = indicatorLength;

                    //붙임딱지 indicator center 위치 (22.03.29)

                    var diff = (400 - 60 * indicatorLength + (indicatorLength - 1)) / 2;
                    if (File.get('center')) {
                        $W('mlc$indicator_1').moveTo(1280 - 60 - diff, $W('mlc$indicator_1').get('y'));
                    }

                    //

                    for (var i = 1; i <= indicatorLength; i++) {
                        indicators.push(indicatorCount--);
                        !$W('mlc$indicator_' + i, undefined, { checkOnly: true }) && copyIndicatorBack.clone().set('label', 'mlc$indicator_' + i);
                        var newIndicatorBack = $W('mlc$indicator_' + i);
                        if (i > 1) {
                            if (indicatorLength >= 8) {
                                $W('mlc$indicator_', undefined, { multiple: true, like: true }).forEach(function (mlc) {
                                    mlc.changeState('Layer5');
                                });
                                padding = 52;
                            } else if (indicatorLength > 4 && indicatorLength < 8) {
                                $W('mlc$indicator_', undefined, { multiple: true, like: true }).forEach(function (mlc) {
                                    mlc.changeState('Layer3');
                                });
                                padding = 60;
                            } else if (indicatorLength <= 4) {
                                $W('mlc$indicator_', undefined, { multiple: true, like: true }).forEach(function (mlc) {
                                    mlc.changeState('Layer1');
                                });
                                padding = 65;
                            }
                            newIndicatorBack.moveTo($W('mlc$indicator_' + (i - 1)).get('x') - padding, '');
                        }
                    }

                    if (indicatorLength >= 8) {
                        $W('mlc$indicator_', undefined, { multiple: true, like: true }).forEach(function (mlc) {
                            var num = mlc.get('label').split('_')[1];
                            mlc.set('x', mlc.get('x') + 33);
                        });
                    }
                    set('$indicators', indicators);
                }
            }

            // 인디케이터 show|hide
            function visibleIndicator(state) {
                var indicatorType = Event.param.split('|')[2];
                var indicatorLength = get('$indicatorLength');
                if (get('$indicator:style').indexOf('star') !== -1 && (indicatorType ? indicatorType === 'star' : true)) {
                    $W('mlc$indicator_', undefined, { mulitple: true, like: true }).forEach(function (indicator) {
                        indicator.set('visibility', state);
                    });
                } else if (get('$indicator:style').indexOf('gauge') !== -1 && (indicatorType ? indicatorType === 'gauge' : true)) {
                    var indicator = $W('mlc$skit_indicator');
                    if (state == 'visible') {
                        indicator.set('visibility', 'visible');
                    } else {
                        indicator.set('visibility', 'hidden');
                    }
                }
            }

            // 인디케이터 개수 만큼 활성화
            function setIndicator() {
                var indicatorVal = Event.param.split('|')[2];
                var indicatorType = Event.param.split('|')[3];
                var indicatorLength = get('$indicatorLength');
                var indicator;
                if (get('$indicator:style').indexOf('star') !== -1 && (indicatorType ? indicatorType === 'star' : true)) {
                    get('$indicators').forEach(function (indicatorNum, index) {
                        indicator = $W('mlc$indicator_' + indicatorNum);
                        if (index < indicatorVal) {
                            if (indicatorLength >= 8) {
                                indicator.changeState('Layer6');
                            } else if (indicatorLength > 4 && indicatorLength < 8) {
                                indicator.changeState('Layer4');
                            } else if (indicatorLength <= 4) {
                                indicator.changeState('Layer2');
                            }
                        }
                    });
                }
                if (get('$indicator:style').indexOf('gauge') !== -1 && (indicatorType ? indicatorType === 'gauge' : true)) {
                    $W('i$skit_indicator_', undefined, { multiple: true, like: true }).forEach(function (indicator, index) {
                        /*index < indicatorVal && */ $W('i$skit_indicator_' + (index + 1)).set('visibility', index < indicatorVal ? 'visible' : 'hidden');
                    });
                }
            }

            // 인디케이터 위치 변경
            function moveIndicator() {
                var indicatorPos = {
                    x: parseInt(Event.param.split('|')[2]),
                    y: parseInt(Event.param.split('|')[3]),
                };
                var indicatorType = Event.param.split('|')[4];
                // if( get("$indicator:style").indexOf("star") !== -1 && (indicatorType ? indicatorType === "star" : true) ) {
                // }
                if (get('$indicator:style').indexOf('gauge') !== -1 && (indicatorType ? indicatorType === 'gauge' : true)) {
                    $W('mlc$skit_indicator').moveTo(indicatorPos.x, indicatorPos.y);
                }
            }

            // bgm 음량 점점 올라감
            function bgmFadeIn() {
                var originVolume = get('$bgm:volume');
                var recursive = function (i) {
                    if (i <= originVolume) {
                        setTimeout(function () {
                            i += 0.01;
                            $W('a$bgm').setData('volume', i);
                            recursive(i);
                        }, 50);
                    }
                };
                recursive($W('a$bgm').getData('volume'));
            }

            // bgm 음량 점점 줄어듬
            function bgmFadeOut() {
                var recursive = function (i) {
                    if (i >= 0) {
                        setTimeout(function () {
                            i -= 0.01;
                            $W('a$bgm').setData('volume', i);
                            recursive(i);
                        }, 50);
                    }
                };
                recursive($W('a$bgm').getData('volume'));
            }

            // 팝업 창 보여줌
            function showPopup(wgt) {
                var popup = wgt;
                popup.set('visibility', 'visible');
                popup.zIndexTo('Top');
                popup.moveTo(0, 0);
            }

            function showEndApi() {
                kmnm.app.audio.cancelRecord();
                kmnm.app.audio.stopRecordedAudio();
                kmnm.app.camera.hide();
            }

            // 엔딩
            function ending() {
                showEndApi();
                var type = get('$template:option')[0][3];
                var resultNum = type.split('.')[0];
                var finishAudio = $W('a$finish_' + resultNum);
                finishAudio.set('media', get('$template:option')[0][5]);
                finishAudio.changeState('Play');
                $W('a$bgm').changeState('Stop');
                showPopup($W('mlc$result_' + resultNum));
                fireEvent('Custom', 'ON_END_' + resultNum);
            }
        }
    },
    {
        target: ['Overlay'],
    }
);

//Transition 동작 도중 Page Reset이 되었을 때 onEnd가 실행되는 현상 방지를 위한 실행기 함수 Override
apn.CES.prototype.$O7W = function () {
    if (!this.$O7V) return;
    for (var i in this.$O7V) {
        if (this.$O7V[i]) {
            var split = i.split(':');
            if (split.length == 2) {
                bx.Transition.cancel(parseInt(split[0]), split[1]);
            }
        }
    }
    delete this.$O7V;
};